(18, 'sssssssssss', 1, '"Boletines SAN VIRILA HOTELES" <noreply@[DOMAIN]>', 'sssssssssss', '<table border="0" cellspacing="0" cellpadding="0" align="center">\n<tbody>\n<tr>\n<td>\n<h2 style="margin: 0px;">OFERTA VELADA ROMANTICA</h2>\n<h3 id="news_preview_subtitle" style="font-style: italic; margin: 0px;">Hotel Tximista, Hotel Villa de Marcilla y Hotel El Mirador de Ulzama</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p><img src="http://www.sanvirilahoteles.com/FILES/modNewsletters/images/Flower_Banner.jpg" alt="" width="571" height="160" /></p>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Aproveche esta oferta especial, v&aacute;lida todos los d&iacute;as de la semana, y sorprenda a su pareja con una experiencia inolvidable.</p>\n<hr />\n<p><br /> <span id="news_preview_body">&nbsp;</span></p>\n<p><span style="text-decoration: underline;">HOTEL TXIMISTA</span></p>\n<p>La oferta incluye comida &oacute; cena rom&aacute;ntica, botella de cava &oacute;  champagne en la habitaci&oacute;n y alojamiento en doble est&aacute;ndar con Desayuno e  IVA incluido,<strong>&nbsp;</strong></p>\n<p>Precio cerrado de&nbsp;90 euros por persona y noche.</p>\n<ul>\n<li>Suplemento en suite: 25 &euro; / pax.</li>\n<li>Oferta v&aacute;lida a lo largo de todo el a&ntilde;o 2009, excepto Fiestas de Estella. </li>\n</ul>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;">HOTEL VILLA DE MARCILLA</span></p>\n<p>La oferta incluye comida o cena rom&aacute;ntica, botella de cava en la  habitaci&oacute;n y alojamiento en doble est&aacute;ndar con desayuno e IVA incluido.</p>\n<p>Precio cerrado de&nbsp;90 euros por persona y noche.</p>\n<ul>\n<li>Suplemento en suite: 25 &euro; / pax.</li>\n<li>Oferta v&aacute;lida a lo largo de todo el a&ntilde;o 2009.</li>\n</ul>\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;">HOTEL EL MIRADOR DE ULZAMA</span></p>\n<p>La oferta incluye comida &oacute; cena rom&aacute;ntica, botella de cava en la  habitaci&oacute;n y alojamiento en doble est&aacute;ndar co