(16, 'titulo de prueba', 1, '"Boletines SAN VIRILA HOTELES" <noreply@[DOMAIN]>', 'LOS MEJORES DESCUENTOS DEL VERANO', '<table border="0" cellspacing="0" cellpadding="0" align="center">\n<tbody>\n<tr>\n<td><span style="font-size: xx-large;">lorem ipsum dolor sit amet</span></td>\n</tr>\n<tr>\n<td><img src="http://www.sanvirilahoteles.com/FILES/modNewsletters/images/Flower_Banner.jpg" alt="" width="571" height="160" /></td>\n</tr>\n<tr>\n<td>\n<h2 style="margin: 0px;">LOS MEJORES DESCUENTOS DEL VERANO</h2>\n<h3 id="news_preview_subtitle" style="font-style: italic; margin: 0px;">Disfrute de hasta un 20 % de descuento en su habitacion</h3>\n<p><br /> <span id="news_preview_header" style="font-style: italic;">\n<p>Viva la semana mas barata de sus vacaciones en un gran hotel, con un  entorno inmejorable y con un monton de actividades para disfrutar.</p>\n</span></p>\n<hr />\n<p><br /> <span id="news_preview_body">\n<p>Oferta para reservas a partir de 7 noches</p>\n<p>Busque el precio de la habitacion , que mas le interese y al  pernoctar 7 noches con nosotros le haremos un 15 % de descuento y si  anticipa 15 dias su confirmacion a la fecha de llegada aprovechese de  otro 5 % de descuento.</p>\n<p>&nbsp;</p>\n<p>Descuentos no acumulables con otras ofertas.</p>\n<p>&nbsp;</p>\n<p>+ Info: <a href="mailto:info@elmiradordeulzama.com">info@elmiradordeulzama.com</a></p>\n<p>&nbsp;</p>\n</span> <input id="news_id" type="hidden" value="97" /> <br />Full version: <a href="http://[domain]/news/details/97">http://[DOMAIN]/news/details/97</a></p>\n</td>\n</tr>\n</tbody>\n</table>', 'lorem ipsum dolor sit amet\nLOS MEJORES DESCUENTOS DEL VERANO\nDisfrute de hasta un 20 % de descuento en su habitacion\nViva la semana mas barata de sus vacaciones en un gran hotel, con un entorno inmejorable y con un monton de actividades para disfrutar.\nOferta para reservas a partir de 7 noches\nBusque el precio de la habitacion , que mas le interese y al pernoctar 7 noches con nosotros le haremos un 15 % de descuento y si anticipa 15 dias su confirmacion a la fecha de llegada aprovechese de otro 5 % de descuento.\n\nDescuentos no acumulables con otras ofertas.\n\n+ Info: info@elmiradordeulzama.com\n\nFull version: http://[DOMAIN]/news/details/97', '---------------\nSi no desea recibir mÃ¡s boletines,  [UNSUBSCRIBEURL]\n\nTo update your preferences and to unsubscribe visit [PREFERENCESURL]\n-------------------------', '', '2010-09-15 18:04:07', 2),
(15, '111111Âº', 1, '"Boletines SAN VIRILA HOTELES" <noreply@[DOMAIN]>', 'DESCUBRA EL PARQUE NATURAL DE URBASA Y EL NACEDERO DEL UREDERRA. (85,00â‚¬)', '<h2 style="margin: 0px;">DESCUBRA EL PARQUE NATURAL DE URBASA Y EL NACEDERO DEL UREDERRA. (85,00&euro;)</h2>\n<h3 id="news_preview_subtitle" style="font-style: italic; margin: 0px;">Aproveche nuestra oferta especial para amantes de la naturaleza.</h3>\n<p><br /> <span id="news_preview_header" style="font-style: italic;">\n<p>Descubra la naturaleza en estado puro a trav&eacute;s de una visita guiada a la espectacular&nbsp;Sierra de Urbasa, una gigantesca meseta formada por un buen numero de colinas y cubiertas de un espeso bosque de hayas muy bien conservado. Cuando recorres el bosque da la impresi&oacute;n que a&uacute;n puede albergar a duendes y brujas. El visitante podr&aacute; disfrutar de uno de los rincones m&aacute;s bonitos de nuestra comunidad, el nacedero del r&iacute;o Urederra.</p>\n</span></p>\n<hr />\n<p><br /> <span id="news_preview_body">\n<p><strong>Estancia en r&eacute;gimen de AD + Visita guiada Urbasa =&nbsp;85 euros </strong></p>\n<ul>\n<li>Precio por persona y noche en habitaci&oacute;n doble, IVA incluido.</li>\n<li>Suplemento habitaci&oacute;n uso individual:&nbsp;50 &euro;.</li>\n<li>Oferta excepto Fiestas de Estella.</li>\n<li>Oferta para grupos, m&iacute;nimo&nbsp;10 personas.</li>\n</ul>\n<p>+ info : <a href="mailto:info@hoteltximista.com">info@hoteltximista.com</a></p>\n</span> <input id="news_id" type="hidden" value="30" /> <br />Full version: <a href="http://[DOMAIN]/news/details/30">http://[DOMAIN]/news/details/30</a></p>', 'DESCUBRA EL PARQUE NATURAL DE URBASA Y EL NACEDERO DEL UREDERRA. (85,00â‚¬)\nAproveche nuestra oferta especial para amantes de la naturaleza. \n\nDescubra la naturaleza en estado puro a travÃ©s de una visita guiada a la espectacular&nbsp;Sierra de Urbasa, una gigantesca meseta formada por un buen numero de colinas y cubiertas de un espeso bosque de hayas muy bien conservado. Cuando recorres el bosque da la impresiÃ³n que aÃºn puede albergar a duendes y brujas. El visitante podrÃ¡ disfrutar de uno de los rincones mÃ¡s bonitos de nuestra comunidad, el nacedero del rÃ­o Urederra.\n\n\nEstancia en rÃ©gimen de AD + Visita guiada Urbasa =&nbsp;85 euros \n\nPrecio por persona y noche en habitaciÃ³n doble, IVA incluido.\nSuplemento habitaciÃ³n uso individual:&nbsp;50 â‚¬.\nOferta excepto Fiestas de Estella.\nOferta para grupos, mÃ­nimo&nbsp;10 personas.\n\n+ info : info@hoteltximista.com\n\n<br/>Full version: http://[DOMAIN]/news/details/30', '---------------\nSi no desea recibir mÃ¡s boletines,  [UNSUBSCRIBEURL]\n\nTo update your preferences and to unsubscribe visit [PREFERENCESURL]\n-------------------------', '', '2010-09-15 17:12:27', 1);
